Layer::Layer()
{

	Init();
	//Draw();
}

Layer::~Layer()
{
}

void Layer::SetMap(MAP_ID mapID)
{
	mMapID = mapID;
}

void Layer::Update(Vector2 offset)
{
	mOffset = { offset.x_,offset.y_ };
}

void Layer::Draw(Vector2 offset)
{
	MAP_ID mapID = lpMapMng.GetMapId();

	for (int y = 0; y < MAP_Y; y++)
	{
		for (int x = 0; x < MAP_X; x++)
		{

			switch (mapID)
			{
			case MAP_ID::FOREST:
				DrawGraph(32 * x - offset.x_, 32 * y - offset.y_, mChipImage1[Rforest[y][x]], true);
				break;
			case MAP_ID::WA:
				DrawGraph(32 * x - offset.x_, 32 * y - offset.y_, mChipImage2[Rwa[y][x]], true);
				break;
			case MAP_ID::WASHOP:
				break;
			case MAP_ID::CAVE:
				break;
			case MAP_ID::CAVESHOP:
				break;
			case MAP_ID::DARK:
				DrawGraph(32 * x - offset.x_, 32 * y - offset.y_, mChipImage4[RdarkTemple[y][x]], true);
				break;
			case MAP_ID::FORESTIN:
					DrawGraph(32 * x - offset.x_, 32 * y - offset.y_, mChipImage1[RforestIn[y][x]], true);
				break;
			case MAP_ID::TEMPLE:
					DrawGraph(32 * x - offset.x_, 32 * y - offset.y_, mChipImage1[Rtemple[y][x]], true);
				break;
			case MAP_ID::TEMPLEIN:
					DrawGraph(32 * x - offset.x_, 32 * y - offset.y_, mChipImage1[RtempleIn[y][x]], true);
				break;
			case MAP_ID::SWEETS:
				break;
			case MAP_ID::SWEETSOUT:
				DrawGraph(16 * x - offset.x_, 16 * y - offset.y_, mChipImage3[RsweetsIn[y][x]], true);
				break;
			case MAP_ID::SWEETSSCHOOL:
				break;
			case MAP_ID::TRANGETIONS:
				break;
			case MAP_ID::MAX:
				break;
			default:
				break;
			}

		}
	}
}

bool Layer::Init(void)
{
	if (LoadDivGraph("./image/map.png", 2800, 56, 50, 32, 32, &mChipImage1[0]) == -1)
	{
		return false;
	}
	if (LoadDivGraph("./image/A123.png", 4560, 30, 152, 32, 32, &mChipImage2[0]) == -1)
	{
		return false;
	}
	if (LoadDivGraph("./image/s3.png", 10000, 100, 100, 16, 16, &mChipImage3[0]) == -1)
	{
		return false;
	}
	if (LoadDivGraph("./image/A1.png", 378, 9, 42, 32, 32, &mChipImage4[0]) == -1)
	{
		return false;
	}
}
